description:
This finger play  teaches, movement, counting and rhyme.
LYRICS
Hickory, dickory dock;
The mouse ran up the clock;
The clock stuck one,
the mouse ran down;
Hickory dickory dock.

Hickory, dickory dock,
The mouse ran up the clock,
The clock struck two
the mouse said "Boo"
Hickory, dickory dock.

Hickory dickory dock;
the mouse ran up the clock;
The clock struck three,
The mouse said "Whee"
Hickory dickory dock.

Hickory dickory dock;
The mouse ran up the clock;
The clock struck four,
The mouse said "no more!"
Hickory, dickory dock.

